	(8,'7111265','9390','Prorrogacao e Retifi','Hospital Municipal Odilon Behrens','7386','0','Av. Jose Bonifacio, s/n','0','(31) 3277-6178','0','0','Belo Horizonte','MG','108/2016','PE','Prazo para Abertura das Propostas','2016-08-18','10:00','0,00','CONTRATACAO DE EMPRESA ESPECIALIZADA EM REALIZAR PROCESSO SELETIVO PARA\nPROVIMENTO DE VAGAS NO PROGRAMA DE RESIDENCIA MULTIPROFISSIONAL EM SAUDE  PRM DO\nHOSPITAL METROPOLITANO ODILON BEHRENS','0','Bradesco - Agencia: 3478.9 - Conta: 32838.3','PROCESSO: 02-47/2016','www.pbh.gov.br','\n\n	http://www.licitacao.com.br/editais/BBnovo/2016/julho/258120.zip *** \n	http://www.licitacao.com.br/editais/BBnovo/2016/agosto/258120.zip ','0','0',1,0,5,'2016-08-11 19:01:14','2016-08-11 19:16:36',NULL),
	(9,'7095407','9349','0','Secretaria Municipal de Assistencia e Desenvolvimento Social','14668','0','Rua Libero Badaro, 561/ 569','5. andar','(11) 3291-9712 / 966','0','0','Sao Paulo','SP','109/2016','SM','0','2016-07-25','14:30','0,00','SERVICO DE ACOLHIMENTO INSTITUCIONAL PARA CRIANCAS E ADOLESCENTES  SAICA','0','0','Processo nº 2016-0.121.065-1','http://www.prefeitura.sp.gov.br / http://e-negocioscidadesp.prefeitura.sp.gov.br','0','Comunicado','CONCLUSIVO DO COMITÊ DE\nAVALIAÇÃO\nPROCESSO ADMINISTRATIVO Nº 2016.0.121.065-1- EDITAL:\n109/SMADS/2016\nComitê de avaliação: Daniel Pregnolatto Maia R.F. 778.458-\n9, Marina Lopes Fernandes Alves  R.F. 777.639-0, Roselene\nL. Constantino de Oliveira  RF 777.734-5 e suplentes: Aline\nZelzino Amador  RF 823.546-5, Vitor Vicente de Albuquerque\nR.F. 504.240-2.\nData em que o comitê se reuniu para elaborar o parecer\ntécnico: 27/07/2016, no CREAS Penha.\nServiço ofertado: SAICA  Serviço de Acolhimento Institucional\npara Criança e Adolescentes, para 15 vagas, mais\n2 excepcionalmente para as frentes frias, em imóvel locado\npela O.S., sito á Rua Astorga, nº912, Vila Guilhermina, na área\nde abrangência dos distritos da Subprefeitura Penha, com\nrepasse de SMADS de recurso mensal de R$ 63.204,03 para\norganizações sociais com isentas da cota patronal do INSS e R$\n73.539,55 para Organizações sociais não isentas, prevendo-se\nainda a liberação de verba de implantação no valor de até R$\n7.000,00.\nData de realização da audiência pública: Dia 25.07.2016, às\n13:11 horas, na Supervisão de Assistência Social - SAS Penha,\nlocalizada na Rua Henrique Jacobs, n.º 788/798  sala de reunião\n Artur Alvim.\nNúmero de propostas apresentadas: O Comitê de avaliação\nrecebeu uma proposta ofertada pela proponente Centro de\nAssistência e Promoção Social Nosso Lar, a qual necessitou\nde complementações, entregues de forma tempestiva e satisfatória.\nSíntese da proposta apresentada pela Organização  Proposta\napresentada pela Organização Centro de Assistência e\nPromoção Social Nosso Lar, sediada na Rua Jalisco, 12  Água\nRasa  São Paulo - SP; Documentação: Para habilitar-se ao processo\ndesencadeado, a proponente apresentou ao comitê, na\ndata e horário definidos em edital, declaração de que está apta\na apresentar todos os documentos exigíveis para celebração de\nconvênio com SMADS, Certificado de inscrição no COMAS,\nCMDCA, Certificado de Matrícula em SMADS, encontra-se renovado\naté 30/06/2018 conforme portaria nº 07 de 22/03/16, currículo\nde suas experiências sociais e proposta de desenvolvimento\nde trabalho para o serviço ofertado. Mostrou-se ainda\nregular perante o CADIN; Quanto as suas experiências sociais,\ndeclarações de reconhecimento e parcerias: O CENTRO DE ASSISTENCIA\nE PROMOÇÃO SOCIAL NOSSO LAR iniciou suas\natividades em 1° de julho de 1991, como desmembramento do\nCentro Espírita A Caminho da Luz, onde funcionava desde\n30/09/75, objetivando atender à comunidade de baixa renda\nem suas necessidades básicas, como alimentação, instrução e\napoio social. Ao longo desses anos, construiu unidades assistenciais\npara atendimento a crianças, adolescentes, idosos, moradores\nde rua e famílias de baixa renda. A proponente declara\nque possui alguns serviços de atendimento a diversas demanda\ndas, conveniados ou não, sendo eles: 14 CEIs  Centro de Educação\nInfantil, vinculados a Secretaria de Educação; 02 CCAs;\n01 CEDESP; 06 SAICAS, sendo 02 Porta de Entrada; 01 NCI, todos\nconveniados com a SMADS; 01 ILPI conveniado com a Secretaria\nEstadual de Assistência e Desenvolvimento Social e\ncom a Prefeitura de Guarulhos. A proponente informou ainda\natender diariamente 2262 crianças de 0 a 3 anos em creches;\n300 em CCA; 1200 jovens em educação profissional no CEDESP;\n120 crianças/ adolescentes em SAICA; 200 idosos no Núcleo de\nConvivência de Idosos e 69 idosos em ILPI no município de\nGuarulhos; mensalmente atende 300 famílias no Programa Viva\nLeite. Pontua diversas parcerias. Apresenta Utilidade Pública\nMunicipal, Estadual e Federal; Quanto às instalações físicas: A\nproponente já vem desenvolvendo o serviço desde 2011, em\nimóvel locado pela OS, na Rua Astorga, 912, Vila Guilhermina,\nvinculado ao CREAS Penha. Trata-se de um imóvel tipo sobrado,\nsem placa de natureza institucional e endereço sigiloso. Possui\nno piso térreo 01 garagem, 01 sala de estar, 01 banheiro acessível,\n01 cozinha equipada e adequada de acordo com a legislação\nespecífica, 01 despensa para alimentos, 01 sala de jantar,\n01 sala para enfermagem e 01 sala de estar para crianças menores.\nNo piso superior há 01 dormitório com lavabo, utilizado\npara crianças e bebês misto, 01 dormitório feminino e 01 dormitório\nmasculino, 01 banheiro feminino, 01 banheiro masculino e\n01 rouparia. No piso térreo externo há 01 amplo quintal em\nparte coberto e parte descoberto, utilizado como área de lazer,\ncom grande brinquedo conjugado e espaço para desenvolvimento\nde diversas atividades lúdicas, 01 sala para guardar materiais\nde limpeza e higiene, 01 banheiro e 01 sala para os funcionários,\n01 lavanderia com 03 máquinas de lavar e 01 tanque.\nO valor do aluguel informado corresponde a R$ 6.262,05 e IPTU\nR$ 708,83; Quanto à abrangência territorial: A proponente informa\nabrangência dos distritos vinculados a subprefeitura da\nPenha. Ressalta que quando houver indicação ou quando a\noferta de vaga for insuficiente, o serviço poderá acolher crianças\ne adolescentes de outras regiões da cidade. Quanto à vinculação\nda ação com as orientações do Plano Municipal de Assistência\nSocial: Neste item a proponente informa que será de\nacordo as orientações do Plano Municipal da Assistência Social\ne diretrizes nacionais - LOAS, PNAS, SUAS / Proteção Social Especial\nCRAS/CREAS / Tipificação Nacional de Serviços Socioassistenciais,\nProtocolo de Gestão Integrada de Serviços, Benefícios\nde Transferência de Renda. Quanto à forma que utilizará\npara acesso dos usuários e de controle de demanda pelas ofertas\ndo serviço: A proponente informa que o acesso se dará por\ndeterminação do Poder Judiciário e por requisição do Conselho\nTutelar, sendo que neste ultimo a autoridade competente deverá\nser comunicada conforme previsto no art. 93 do ECA. O serviço\nde acolhimento institucional tem o funcionamento ininterrupto,\ndestinado ao atendimento de 15 crianças e adolescentes,\nacrescidos de até 2 vagas, excepcionalmente para atender períodos\nde baixa temperatura.; Quanto à metodologia de trabalho:\nA proposta apresentada mostrou-se adequada ao edital, descrevendo\nsobre diversas ações norteadoras, sendo estas: atendimento\npersonalizado e individualizado, o ambiente e os cuidados\ndeverão ser facilitadores do desenvolvimento, construção\ndo PIA, garantia do direito à convivência familiar, fortalecimento\nda convivência comunitária, integração social, desligamento\ndo usuário com preparação prévia e alimentação; Quanto aos\nresultados esperados, monitoramento e avaliação: o controle e\navaliação serão realizados continuamente e em conjunto entre\na Organização Social e técnicos do Poder Judiciário e do CREAS\nque darão constantemente respaldo às atividades inerentes ao\nserviço, através de informações e sugestões, visando sempre o\nbem estar e ressocialização das crianças/adolescentes. A proponente\ninforma que a execução do serviço será avaliada através\nde instrumentais específicos, a partir do levantamento contínuo\nde diversos dados especificados na proposta. Apontou indicadores\nde avaliação do serviço, de acordo com a Portaria 46/2010/\nSMADS; Quanto ao conhecimento do território de implantação\ndo serviço e trabalho social com famílias: A proponente demonstrou\nem sua proposta conhecimento do território, abordando\ncaracterização, contexto histórico, localização, equipamentos\nde Saúde, Educação, Sócio-Assistenciais e de Segurança\nPública. Quanto ao conhecimento e capacidade de articulação\ncom os serviços da rede sócio-assistencial local e políticas publicas\nsetoriais: A Proponente propõe uma articulação com os\nrecursos sócio-assistencias dos serviços e equipamento de SAS/\nCRAS. Refere ainda que partirá da rede local a mobilização dos\nórgãos oficiais, lideranças, Org. não Governamentais, Família,\nComunidades, Comercio e Empresas para inserir os jovens na\ncomunidade. Deverá ainda manter articulação sistemática com\nCRAS e CREAS, Sistema de Garantia de Direitos, Conselhos Tutelares,\nConselho de Defesa, MP, VIJ e Defensoria Pública; Quanto\nao quadro de recursos humanos: O quadro de recursos humanos\nmostrou-se compatível ao edital, no que se refere ao número\nde profissionais necessários à execução do serviço, funções e\nsalários. Igualmente no que se refere à escolaridade e atribuições\ndestes; Quanto à distribuição dos profissionais para operacionalização\ne gestão do serviço para a garantia dos resultados\ne metas estipuladas: A proponente apresenta neste tópico, as\nfunções e competências dos profissionais que compõe o RH do\nServiço. Quanto a questão da carga horária, encontra-se em\nconsonância com o Edital. Quanto à seleção dos profissionais e\ncapacitação continuada: Esclarece que tanto o processo de seleção,\nquanto de capacitação continuada será feito em conjunto\ncom a SAS, CRAS/ CREAS, SMADS e ESPASO. O processo seletivo\nterá como objetivo a seleção de profissionais que se enquadrem\nno perfil apresentado com habilidades e conhecimento para a\nfunção. Será oferecido pela O.S. por meio das horas técnicas a\nformação, capacitação e assessoramento técnico promovido in\nloco de forma personalizada e atenta as especificidades da\ndemanda enfrentada; Quanto aos demais elementos que compõem\na tabela de custeio do serviço: A proponente não informa\nser isenta ou não da cota patronal do INSS, no entanto, apresenta\no valor de R$ 70.174.91 de repasse mensal (com aluguel\ne IPTU), sendo este para Org. com isenção da cota patronal.\nValor anual do serviço apresentado R$ 842.098,92; Quanto à\ncontrapartida da Organização: A proponente apresenta como\ncontrapartida a provisão de bens de consumo e demais itens de\nnecessidades não previstos nos custos referenciais, alem de se\ncomprometer financeiramente com valores excedentes, quando\napresentados na prestação de contas; Quanto à verba de implantação:\nA proponente não solicita verba de implantação,\nhaja vista que já vem executando o serviço em tela.\nCONCLUSÃO DO COMITÊ: Após análise da proposta apresentada,\nmanifestações exaradas em audiência pública e complementações\nentregues a este comitê, o mesmo considera o\nCentro de Assistência e Promoção Social Nosso Lar, como apta\na celebrar convênio com esta Pasta para a execução do Serviço\nde Acolhimento Institucional para Crianças e Adolescentes, para\n15 vagas, mais 2 excepcionalmente em período de frentes frias,\nno distrito Vila Matilde, sob a abrangência Distrital, nos distritos\ncompreendidos pela Subprefeitura Penha (Cangaiba, Penha,\nVila Matilde e Arthur Alvim, em imóvel locado pela O.S., sito\ná Rua Astorga 912 Vila Guilhermina, com custo mensal de R$\n63.204,03, por tratar-se de Organização isenção de cota patronal\ndo INSS. A escolha da proponente levou em consideração: a\ncongruência da proposta com o Plano Municipal de Assistência\nSocial do Município de São Paulo  PLAS, de forma a verificar\nas possibilidades que a proposta apresentada oferece para\nalcance das metas nele indicadas; a qualidade das experiências\nsociais da organização/entidade/associação proponente, e a\ncompatibilidade delas com o tipo de serviço a ser executado,\na luz do currículo de experiências sociais e das declarações\nde reconhecimento de suas práticas emitidas por instituições\ngovernamentais, a a compatibilidade entre a proposta apresentada,\nas ofertas e os padrões específicos que compõem o\ntipo de serviço indicado no subitem 1.1 do item 1 objeto e\nunidades deste edital, constantes nas Portarias 46/SMADS/2010\ne 47/SMADS/2010 publicadas em DOC 15/02/2011; a compatibilidade\nentre a proposta apresentada e a Tabela de Custos por\nElementos de Despesa dos Serviços Socioassistenciais instituída\nnas Portarias 46/SMADS/2010 e 47/SMADS/2010 e complementações\ncontidas neste edital; a capacidade de potencializar\ne distribuir recursos humanos para a gestão dos serviços e a\ngarantia de viabilizar resultado; a especificação e qualificação\ndos recursos humanos que disponibilizarão para o serviço,\nsegundo parâmetros da SMADS; a disposição para garantir o\ncaráter público da parceria com a Prefeitura do Município de\nSão Paulo, na divulgação do serviço a ser prestado e na atenção\nao usuário; e por fim que a organização vem executando de\nforma satisfatória o referido serviço no território. A proponente\npoderá apresentar manifestação, no prazo de 5 dias, acerca do\nparecer técnico do Comitê de Avaliação publicado no Diário\nOficial da Cidade de São Paulo conforme disposto no item 7 do\nreferido edital.\nSão Paulo, 27 de Julho de 2016.\nDaniel Pregnolatto Maia R.F. 778.458-9 (Presidente)\nMarina Lopes Fernandes Alves  R.F. 777.639-0\nRoselene L. Constantino de Oliveira  R.F. 777.734-5\nAline Zelzino Amador  R.F. 823.546-5\nVitor Vicente de Albuquerque  R.F. 504.240-2\n\nDOMSP - 02/08/2016\n',0,0,7,'2016-08-11 19:01:26','2016-08-11 19:01:26',NULL),
	(10,'7077005','9334','0','Prefeitura Municipal de Viana','13253','0','Av. Florentino Avidos, 01','0','(27) 2124-6731','0','horario de atendimento: das 12h00 as 18h00','VIANA','ES','16/2016','TP','0','2016-07-15','13:00','0,00','CONTRATACAO DE EMPRESA ESPECIALIZADA NA PRESTACAO DE SERVICOS, PARA A REALIZACAO DE CONCURSO PUBLICO PARA O CARGO DE ASSISTENTE ADMINISTRATIVO, CONTADOR, MEDICO PERITO PREVIDENCIARIO E PROCURADOR AUTARQUICO, DO INSTITUTO DE PREVIDENCIA SOCIAL DOS SERVIDORES PUBLICOS DO MUNICIPIO DE VIANA - IPREVI','0','0','0','0','0','Habilitacao e data para abertura do envelope 2 - proposta','AVISO DE RESULTADO DE\nHABILITAÇÃO\nTOMADA DE PREÇOS\nNº 016/2016\nPROCESSO: 0505/2015\nA Prefeitura de Viana, através da 2ª\nComissão Permanente de Licitação,\ncom base na Lei nº. 8.666/93 e\nsuas alterações, Lei complementar\n123/2006 comunica aos\ninteressados o resultado de analise\ndos documentos de habilitação\nda TOMADA DE PREÇOS nº.\n016/2016 - Objeto: Contratação\nde Empresa Especializada na\nPrestação de Serviços, para a\nrealização de Concurso Público\npara o Cargo de Assistente\nAdministrativo, Contador, Médico\nPerito Previdenciário e Procurador\nAutárquico, do Instituto de\nPrevidência Social dos Servidores\nPúblicos do Município de Viana -\nIPREVI - as empresas participantes INABILITADAS: ETHOS - Concurso\nPúblicos Ltda., não atendeu\nsubitem 6.3.g do Edital, Instituto\nde Educação e Desenvolvimento\nSocial NOSSO RUMO não atendeu\nsubitem 6.2.1 do Edital, Objetiva\nConcursos Ltda., não atendeu\nsubitem 6.4.2 do Edital, Instituto\nCONSULPAM Consultoria Publica\n- Privada, não atendeu subitem\n6.4.2 do Edital, AGESP - Apoio em\nGestão de Saúde Publica-ME., não\napresentou atestados, a quantidade\ne as funções dos profissionais\nselecionados e GUALIMP Assessoria\ne Consultoria não atendeu\nsubitem 6.4.2 do Edital. Empresa\nparticipante HABILITADA: IBEG -\nInstituto Brasileiro de Educação e\nGestão. Abre-se o prazo recursal\nconforme determina o art. 109,\nalínea a da Lei 8.666/93 e\nalterações posteriores, e caso não\nhaja interposição de recurso, fica\ndesde já, marcada a abertura\ndos envelopes das Propostas de\nPreços para às 13h00min no dia\n12 de agosto de 2016.\nMaiores informações disponível na\nSala da CPL, de segunda a sextafeira,\nde 09:00 às 18:00hs, email:\nsegundacpl@viana.es.gov.br\nViana/ES - 03 de agosto de 2016\n\nDOEES 04/08/2016',0,0,8,'2016-08-11 19:01:31','2016-08-11 19:01:31',NULL),
