	(123,'7018334','9318','0','Prefeitura Municipal de Milha','11299','0','Av. Pedro Jose de Oliveira, 406','0','(88) 3529-1637','0','0','MILHA','CE','5.25.2/2016','TP','0','2016-07-05','10:00','0,00','CONTRATACAO DE EMPRESA ESPECIALIZADA PARA PRESTACAO DE SERVICOS\nTECNICOS EM ORGANIZACAO E EXECUCAO DE CONCURSO PUBLICO PARA\nPROVIMENTO DE CARGOS PUBLICOS CONSTANTES DO QUADRO DE PESSOAL DA PREFEITURA\nMUNICIPAL DE MILHA/CE, CONFORME PROJETO BASICO EM ANEXO AO\nEDITAL.','0','0','0','0','0','Resultado','Tipo: Menor Preço Global\nO Presidente da Comissão Permanente de Licitação da Prefeitura\nMunicipal de Milhã, comunica aos interessados o resultado do\njulgamento de habilitação/inabilitação da licitação na modalidade Tomada\nde Preços nº 2016.05.25.2, que tem por objeto a contratação de\nempresa especializada para prestação de serviços técnicos em organização\ne execução de concurso público para provimento de cargos\npúblicos constantes do quadro de pessoal da Prefeitura Municipal de\nMilhã/Ce, conforme projeto básico em anexo ao edital. Empresas\nHabilitadas: M G A Spazzafumo EPP; Empresas Inabilitada: Instituto\nBezerra Nelson LTDA - ME, por não atender o disposto do subitem\n4.4.3 do Edital, (apresentou a certidão simplificada da junta comercial)\nvencida. CONSEP Consultoria e Estudos Pedagógicos LTDA -\nEPP.- por não comprovar através de seu Contrato Social, parcela de\nmaior relevância: a) Realização de processo de recrutamento e seleção\nde pessoal, através de concurso público; Fundação Vale do\nPiauí - por está suspensa de participar de Licitação Pública pelo\nperíodo de 01 (um) ano, conforme publicação feita no Diário Oficial\ndos Municípios do Estado de Goiás, publicado em 19 de Janeiro de\n2016. Sendo assim, a empresa não está apta a participar desta licitaçãolicitação,\nnão atendendo o disposto do item 3- subitem 3.3, do Edital.\nPortanto fica aberto o prazo recursal conforme estabelece o art. 109\nparágrafo I alínea a da Lei 8.666/93. Comunicamos, portanto, que\napós transcorrido o prazo recursal, sem que seja impetrado nenhum\nrecurso, a abertura do envelope B - Propostas de Preços das empresas\nhabilitadas, será realizada no dia 15 de Julho de 2016 às 10:00hs.\nMaiores informações poderão ser obtidas através do Fone 88.3529 1637.\n\n\nDou  07/07/2016',0,0,66,'2016-08-11 19:09:53','2016-08-11 19:09:53',NULL),
