	(136,'6990489','9357','0','COSANPA-Companhia de Saneamento do Para','3667','0','Av. Magalhaes Barata, 1201','0','(91) 3202-8424\n','0','horario de atendimento: das 8h30 as 11h30 e das 14h30 as 17h30','Belem','PA','2/2016','CR','0','2016-07-27','10:00','0,00','SELECAO E CONTRATACAO DE EMPRESA ESPECIALIZADA DE SERVICOS DE ORGANIZACAO E SISTEMATIZACAO DE CONCURSO PUBLICO DE PROVAS E PROVAS E TITULOS, PARA PREENCHIMENTO\nDE VAGAS EM CARGOS DE PROVIMENTO EFETIVO DO QUADRO DE EMPREGADOS DA COSANPA E CADASTRO DE RESERVA, CONFORME TERMO DE REFERENCIA TECNICA DPL 010/2016, BEM COMO NAS ORIENTACOES CONTIDAS NO EDITAL E SEUS ANEXOS, QUE SAO PARTES INTEGRANTES E INDIVISIVEIS DESTE INSTRUMENTO CONVOCATORIO.','0','0','##ANEXO 01 - TERMO DE REFERENCIA\n12. DAS ATRIBUICOES DA CONTRATANTE.\n12.1- CABE A CONTRATANTE:\nONDE SE LE:\n12.1.4- EFETUAR TODAS AS PUBLICACOES E DIVULGACOES QUE SE\nFI ZEREM NECESSARIAS NO DIARIO OFI CIAL DO ESTADO.\nLEIA-SE:\n12.1.4.- EFETUAR TODAS AS PUBLICACOES E DIVULGACOES QUE SE\nFI ZEREM NECESSARIAS NO DIARIO OFI CIAL DO ESTADO PARA QUE OCORRA A\nCONTRATACAO DA EMPRESA RESPONSAVEL PELA ORGANIZACAO DO CERTAME.\nONDE SE LE:\n12.1.6- APROVAR A MINUTA DO EDITAL COMPLETO, ELABORADO PELA CONTRATANTE.\nLEIA-SE:\n12.1.6- APROVAR A MINUTA DO EDITAL COMPLETO, ELABORADO PELA CONTRATADA.##','www.compraspara.pa.gov.br\nwww.cosanpa.pa.gov.br\nwww.comprasnet.gov.br','0','Recurso','AVISO DE JULGAMENTO DE IMPUGNAÇÃO AO EDITAL\nCONCORRÊNCIA PÚBLICA N° 002/2016 - CPL/COSANPA\nO Presidente da Companhia de Saneamento do Pará,\natravés da Comissão Permanente de Licitação, instituída\npela Portaria nº 1055/2015, torna público aos interessados,\nque na CONCORRÊNCIA PÚBLICA N° 002/2016 - CPL/\nCOSANPA- cujo objeto é a SELEÇÃO E CONTRATAÇÃO DE\nEMPRESA ESPECIALIZADA DE SERVIÇOS DE ORGANIZAÇÃO E\nSISTEMATIZAÇÃO DE CONCURSO PÚBLICO DE PROVAS E PROVAS\nE TÍTULOS, PARA PREENCHIMENTO DE VAGAS EM CARGOS\nDE PROVIMENTO EFETIVO DO QUADRO DE EMPREGADOS DA\nCOSANPA E CADASTRO DE RESERVA. Conforme Termo de\nReferência Técnica DPL 010/2016. Comunica que a Impugnação\nao edital em questão, apresentada, foi conhecida como\ntempestiva, mas no mérito foi negado provimento, mantendose\nna íntegra os termos do edital bem como a data de abertura.\nAs razões que motivaram a decisão encontram-se à disposição\ndos interessados para consulta na Comissão de Licitação da\nCOSANPA, Av. Magalhães Barata n° 1201 - São Brás - Belém/PA.\nBelém/PA, 25 de julho de 2016.\n\nDOEPA - 26/07/2016',0,0,71,'2016-08-11 19:10:36','2016-08-11 19:10:36',NULL),
