	(297,'7125786','9441','Comunicado/Convocaca','Prefeitura Municipal de Fortaleza','10291','0','Rua do Rosario, 77','Ed. Comte Vital Rolim','(85) 3105-1150','(85) 3252-1630','0','Fortaleza','CE','10/2016','CR','Prazo para Abertura das Propostas','2016-09-12','09:45','0,00','CONTRATACAO DE EMPRESA PARA PRESTACAO DE SERVICOS ESPECIALIZADOS EM CONSULTORIA OPERACIONAL PARA FORMULAR, IMPLANTAR E EXECUTAR PROCEDIMENTOS TECNICOS DE AUDITAGEM, QUALIFICACAO   DE RECUPERACAO/COMPENSACAO DE CREDITOS ORIUNDOS DO PASEP EM FAVOR DO MUNICIPIO DE FORTALEZA','0','0','A Presidente da COMISSÃO PERMANENTE DE LICITAÇÕES\nDA PREFEITURA MUNICIPAL DE FORTALEZA - CE \nCPL torna público para conhecimento dos Licitantes e demais interessados,\nque no Edital acima epigrafado, cujo Aviso de Licitação\nda Concorrência Pública Nº 010/2016, foi publicado no dia 25 de\njulho de 2016, nos meios de comunicações legais: Diário Oficial do\nMunicípio (DOM), Jornal Municipal Local, Jornal de Circulação Nacional\ne Diário Oficial da União (DOU) N° 141, Pág. 146, Seção 3,\nonde ocorreram atecnias, motivos pelo quais se faz necessário a\npublicação de um Adendo ao Edital corrigindo, nos mesmos meios de\npublicidade. Origem: Secretaria Municipal das Finanças - SEFIN.\nObjeto: Contratação de empresa para prestação de serviços especializados\nem consultoria operacional para formular, implantar e executar\nprocedimentos técnicos de auditagem, qualificação e de recuperação\n/ compensação de créditos oriundos do PASEP em favor do\nMunicípio de Fortaleza em todos os seus Órgãos e Entidades que\ncompõem a Administração Direta e Indireta. Tipo de Licitação: Técnica\ne Preço. Regime de Execução: Empreitada Por Preço Unitário.\nMaiores informações encontram-se à disposição em sua sede situada\nna Rua do Rosário, N° 77, Centro, Ed. Comte. Vital Rolim - Sobreloja\ne Terraço, Fortaleza-CE ou através do Telefone: (85) 3452-\n3477 CPL.','www.fortaleza.ce.gov.br','\n\n	http://www.licitacao.com.br/editais/fortaleza/2016/julho/3.zip *** \n	http://www.licitacao.com.br/editais/fortaleza/2016/julho/3.zip *** \n','0','0',0,0,127,'2016-09-12 19:01:22','2016-09-12 19:01:22',NULL),
	(298,'7209684','9441','Normal','Prefeitura Municipal de Fortaleza','10291','0','Rua do Rosario, 77','Ed. Comte Vital Rolim','(85) 3105-1150','(85) 3252-1630','0','Fortaleza','CE','2/2016','SM','Prazo para Entrega de Propostas','2016-10-10','0','0,00','PRESTACAO DE SERVICOS TECNICOS DE ENGENHARIA PARA ELABORACAO DO PLANO DE ACESSIBILIDADE SUSTENTAVEL DE FORTALEZA E SUA AREA DE INFLUENCIA, CONTEMPLANDO A REALIZACAO DE PESQUISAS DE DEMANDA DE PESSOAS (ORIGEM E DESTINO DOMICILIAR, VOLUMETRICAS, DE PREFERENCIA DECLARADA, ENTRE OUTRAS), DE DEMANDA DE CARGA (ORIGEM E DESTINO DE CARGAS, VOLUMETRICAS, DE PREFERENCIA DECLARADA, ENTRE OUTRAS), MODELAGEM\nDA DEMANDA E DA OFERTA DE TRANSPORTE E DOS SISTEMAS INTERVENIENTES,\nA COMPREENSAO DA PROBLEMATICA DA ACESSIBILIDADE DEFORMA A SUBSIDIAR A ELABORACAO DE CENARIOS DE INTERVENCAO, A PROPOSICAO E ELABORACAO DE CENARIOS DE INTERVENCAO, BEM COMO A AVALIACAO ECONOMICA E SOCIAL DESTES CENARIOS','0','0','O principal objetivo do Plano é prover a cidade de Fortaleza de uma rede de transporte multimodal sustentável que promova a acessibilidade, priorize modos de transporte não motorizados e motorizados de alta capacidade, de\nmaneira a aumentar o bem-estar e a qualidade de vida das pessoas.\nPara o caso do transporte de pessoas a área de estudo deve considerar\nalém da cidade de Fortaleza, os demais municípios que fazem parte\ndo sistema metropolitano de transportes. Para o caso das cargas a área\nde estudo se limita ao Município de Fortaleza. O serviço será executado\nno Município de Fortaleza, no âmbito do Programa de Transporte\nUrbano de Fortaleza II. A Secretaria Municipal de Infraestrutura\n- SEINF convida os consultores elegíveis a apresentar o seu interesse\npara o serviço solicitado. Os consultores interessados deverão proporcionar\ninformação que demonstre que estão qualificados para prestar\nos serviços (folhetos, descrição de serviços semelhantes executados,\nexperiência em condições idênticas, corpo técnico adequado\netc.). É permitida a associação em consórcio para melhorar as suas\nqualificações. Os consultores serão selecionados de acordo com os\nprocedimentos estabelecidos nas Políticas para Seleção e Contratação\nde Consultores Financiadas pelo Banco Interamericano de Desenvolvimento\n(GN-2350-9), e está aberta a todos os Consultores de\nPaíses Elegíveis, conforme definido nestas normas. Os Consultores\ninteressados poderão obter mais informações pelo correio eletrônico\nou por meio do endereço abaixo indicado, entre 08h30min e\n11h30min e das 13h30min às 16h30min, nos dias úteis. As manifestações\nde interesse deverão ser enviadas via postal, ou correio\neletrônico ao endereço abaixo indicado o mais tardar até o dia 10 de\noutubro de 2016. Comissão Extraordinária de Licitações - CEL /\nPREURBIS / TRANSFOR / PROREDES. A/C Eng. Raimundo Valdir\ndos Santos Júnior - Coordenador do TRANSFOR. Av. Paulino Rocha,\nN° 1343, Cajazeiras, CEP: 60864-311, Fortaleza-CE, Brasil. Tel: (55-\n85) 3105-1047 / 3264-8392  Fax: (55-85) 3105-1082. E-mail: licitacao.\ntransfor@fortaleza.ce.gov.br  Site: http://www.fortaleza.\nce.gov.br. Maiores informações encontram-se à disposição em sua\nSede situada na Rua do Rosário, N° 77, Centro, Ed. Comte. Vital\nRolim - Sobreloja e Terraço, Fortaleza-CE ou através do Telefone:\n(85) 3452-3477 PREURBIS/TRANSFOR/PROREDES.','www.fortaleza.ce.gov.br','0','0','0',1,0,127,'2016-09-12 19:01:22','2016-09-12 19:52:08',NULL),
