	(1107,'7249439','9472','Normal','Secretaria Estadual do Meio Ambiente','14480','0','Av. Prof. Frederico Hermann Junior, 345','0','(11) 3133-3979','(11) 3030-6320 / 6177','0','Sao Paulo','SP','2/2016','SM','Prazo para Abertura das Propostas','2016-10-10','0','0,00','CHAMAMENTO PUBLICO CG 02, DE 28 DE SETEMBRO DE 2016    O ESTADO DE SAO PAULO, ATRAVES DE SUA SECRETARIA DO MEIO AMBIENTE, TORNA PUBLICO QUE SE ACHA ABERTO NO GABINETE DO SECRETARIO, O CADASTRAMENTO DE INSTITUICOES BANCARIAS, INTERESSADAS EM FORMALIZAR CONTRATO DE PRESTACAO DE SERVICOS DE ARRECADACAO DE RECEITAS EM SEU FUNDO ESPECIAL DE DESPESA, CRIADO PELO DECRETO ESTADUAL NO 27.143, DE 30/06/1987, RATIFICADO PELA LEI ESTADUAL NO 7.001, DE 27/12/1990 E COM SUA VINCULACAO ALTERADA PELO ARTIGO 3O, DO DECRETO ESTADUAL NO 57.547, DE 29/11/2011, ALTERADO PELO DECRETO ESTADUAL NO 57.590, DE 07/12/2011.     A SELECAO DAS INSTITUICOES BANCARIAS SE DARA COM A OBEDIENCIA, NO QUE COUBER, DAS DISPOSICOES DA RESOLUCAO SF NO 80/2011, DA SECRETARIA DA FAZENDA, EM ESPECIAL NO QUE SE REFERE AO VALOR DA REMUNERACAO PELOS SERVICOS A SEREM PRESTADOS, SENDO QUE A SECRETARIA DO MEIO AMBIENTE PAGARA A INSTITUICAO BANCARIA A REMUNERACAO DE R$ 1,15 (UM REAL E QUINZE CENTAVOS) POR RECEBIMENTO EFETUADO.    A CONTRATACAO SE EFETIVARA NAS CONDICOES PREVISTAS NA MINUTA DE CONTRATO EM ANEXO.    INFORMACOES E ESCLARECIMENTOS ADICIONAIS PODERAO SER OBTIDOS ATRAVES DO E-MAIL CONTRATOS@AMBIENTE.SP.GOV.BR OU ATRAVES DE CORRESPONDENCIA ENDERECADA AO DEPARTAMENTO DE SUPRIMENTOS E APOIO A GESTAO DE CONTRATOS, A AV. PROF. FREDERICO HERMANN JUNIOR, 345 - PREDIO 1 - 6O ANDAR - ALTO DE PINHEIROS - SAO PAULO - SP, CEP 05459-010.    AS INSTITUICOES INTERESSADAS DEVERAO APRESENTAR, A PARTIR DO DIA 29 DE SETEMBRO DE 2016, NO DEPARTAMENTO DE SUPRIMENTOS E APOIO A GESTAO DE CONTRATOS, SEM PREJUIZO DE OUTRO QUE SE FIZEREM NECESSARIOS, OS SEGUINTES DOCUMENTOS:      A) A AUTORIZACAO QUE SE REFERE O Â§ 1O, DO ARTIGO 2O, DA RESOLUCAO SF NO 80, DE 02 DE DEZEMBRO DE 2011.    B) ATO CONSTITUTIVO, ESTATUTO OU CONTRATO SOCIAL ATUALIZADO E REGISTRADO NO ORGAO COMPETENTE.    C) DOCUMENTOS DE ELEICAO OU DESIGNACAO DOS ATUAIS ADMINISTRADORES.    D) DECRETO DE AUTORIZACAO EM SE TRATANDO DE SOCIEDADE EMPRESARIA ESTRANGEIRA EM FUNCIONAMENTO NO PAIS, E ATO DE REGISTRO OU AUTORIZACAO PARA FUNCIONAMENTO EXPEDIDO PELO ORGAO COMPETENTE, QUANDO A ATIVIDADE ASSIM O EXIGIR.    E) PROVA DE INSCRICAO NO CADASTRO NACIONAL DE PESSOAS JURIDICAS DO MINISTERIO DA FAZENDA (CNPJ).    F) CERTIDAO DE NEGATIVA DE DEBITO COM AS FAZENDAS ESTADUAL E MUNICIPAL, DA SEDE OU DO DOMICILIO DA INSTITUICAO.    G) CERTIDAO NEGATIVA DE DEBITOS PERANTE O FUNDO DE GARANTIA POR TEMPO DE SERVICO (FGTS).    H) CERTIDAO CONJUNTA NEGATIVA DE DEBITOS OU POSITIVA COM EFEITO DE NEGATIVA RELATIVA A TRIBUTOS FEDERAIS E DIVIDA ATIVA DA UNIAO.    I)PROVA DE INEXISTENCIA DE DEBITOS INADIMPLIDOS PERANTE A JUSTICA DO TRABALHO, MEDIANTE A APRESENTACAO DE CERTIDAO NEGATIVA, NOS TERMOS DO TITULO VII-A DA CONSOLIDACAO DAS LEIS DO TRABALHO, APROVADA PELO DECRETO-LEI NO 5.452, DE 1O DE MAIO DE 1943.    J) CERTIDAO NEGATIVA DE FALENCIA DA SEDE DA PESSOA JURIDICA.    PARA FINS DE CUMPRIMENTO DO DISPOSTO NOS ITENS  F  A  I , SERAO ACEITAS CERTIDOES POSITIVAS DE DEBITO COM EFEITO DE NEGATIVAS.    A CONTRATACAO DAR-SE-A PELO PRAZO DE 15 (QUINZE) MESES. PROCESSO: 6276/2016','0','0','PROCESSO: 6276/2016            {{168-1089338}}\n\nCONFIRMAR DATA DE ABERTURA JUNTO AO ORGAO LICITANTE','http://www.ambiente.sp.gov.br ','\n\n	http://www.licitacao.com.br/editais/enegocios/2016/setembro/EN10893381102573.docx *** \n\n	','0','0',1,0,67,'2016-10-03 22:51:21','2016-10-06 11:00:55',NULL),
