	(47,18,'Por nada.',1,'Karoline Loureiro Silva ','2016-12-21 10:58:18','2016-12-21 10:58:18',NULL,NULL),
	(48,22,'Bom dia , estou enviando meu currículo para que quando haver alguma oportunidade. Me inscrevi no processo seletivo, para que conseguem visualizar meus dados.',0,'Carla de Paula Rodrigues','2016-12-21 11:33:56','2016-12-21 11:33:56',NULL,14),
	(49,23,'Boa Tarde !\r\nGostaria de saber até que data ficará aberta a inscrição para a seleção do crefito? e o boleto poderá ser pago até que dia? se gerar um boleto novo amanhã, ele terá outra data de vencimento?',0,'Lara Carneiro Zuniga','2016-12-21 11:47:34','2016-12-21 11:47:34',NULL,NULL),
	(50,24,'Bom dia, acabei de me inscrever para um concurso de vocês. Porém acabei solicitando cota para negro acreditando que seria como em todos os concurso, incluindo pardos além de negros, porém pelo que pude perceber lendo o edital, acredito que não. Se não puder realmente pardo concorrer, queria solicitar para alterarem meu pedido de solicitação de cota. Obrigado e aguardo retorno.',0,'Alexandre Barbosa Lacerda','2016-12-21 12:16:16','2016-12-21 12:16:16',NULL,NULL),
	(51,23,'Boa tarde, Lara!\r\n\r\nAs inscrições vão até o dia 13 de fevereiro de 2017. A data de vencimento do boleto é sempre com um prazo de dois dias, após ser gerado. Caso ele vença e você ainda não tenha pago, pode atualizá-lo no site do Banco do Brasil.\r\n\r\nAtenciosamente \r\n  Karoline',1,'Karoline Loureiro Silva ','2016-12-21 15:31:14','2016-12-21 15:31:14',NULL,NULL),
	(52,22,'Boa tarde, Carla!\r\n\r\nEm breve disponibilizaremos um sistema para cadastro de currículos.\r\nAguarde, entraremos em contato por e-mail!\r\n\r\n\r\nAtenciosamente \r\n     Karoline \r\n ',1,'Karoline Loureiro Silva ','2016-12-21 15:37:53','2016-12-21 15:37:53',NULL,NULL),
	(53,24,'Alexandre, boa tarde!\r\nO edital divulgado segue a legislação vigente em relação a cotas para negros em concursos. O item 4.2 cita a orientação normativa que exige apresentação do candidato que se declarar negro a comissão avaliadora e no 4.8-a a eliminação caso a comissão não classifique-o como negro. Podemos alterar sua inscrição, mas precisamos que você confirme o desejo de mudança de cotista para não cotista. Fico no aguardo!\r\n\r\n\r\nAtenciosamente \r\n   Karoline\r\n\r\n',1,'Karoline Loureiro Silva ','2016-12-21 16:11:49','2016-12-21 16:11:49',NULL,NULL),
	(54,26,'Vazio',1,'Karoline Loureiro Silva ','2016-12-21 16:16:07','2016-12-21 16:16:07',NULL,NULL),
