	(67,22,'Boa tarde, Carla! Em breve disponibilizaremos um sistema para cadastro de currículos. Aguarde, entraremos em contato por e-mail! Atenciosamente Karoline',1,'DIOGO RODRIGO CRUZ DE AZEVEDO','2016-12-21 23:40:40','2016-12-21 23:40:40',NULL,NULL),
	(68,23,'Boa tarde, Lara! As inscrições vão até o dia 13 de fevereiro de 2017. A data de vencimento do boleto é sempre com um prazo de dois dias, após ser gerado. Caso ele vença e você ainda não tenha pago, pode atualizá-lo no site do Banco do Brasil. Atenciosamente Karoline',1,'DIOGO RODRIGO CRUZ DE AZEVEDO','2016-12-21 23:41:05','2016-12-21 23:41:05',NULL,NULL),
	(69,24,'Alexandre, boa tarde! O edital divulgado segue a legislação vigente em relação a cotas para negros em concursos. O item 4.2 cita a orientação normativa que exige apresentação do candidato que se declarar negro a comissão avaliadora e no 4.8-a a eliminação caso a comissão não classifique-o como negro. Podemos alterar sua inscrição, mas precisamos que você confirme o desejo de mudança de cotista para não cotista. Fico no aguardo! Atenciosamente Karoline',1,'DIOGO RODRIGO CRUZ DE AZEVEDO','2016-12-21 23:41:23','2016-12-21 23:41:23',NULL,NULL),
	(70,30,'Olá, Boa tarde! Posso ajudar?',1,'DIOGO RODRIGO CRUZ DE AZEVEDO','2016-12-21 23:41:38','2016-12-21 23:41:38',NULL,NULL),
