	(72,35,'teste fim',1,'DIOGO RODRIGO CRUZ DE AZEVEDO','2016-12-22 04:09:46','2016-12-22 04:09:46',NULL,NULL),
	(73,39,'Bom dia,\r\nComo eu faço para obter mais informações sobre essa instituição???',0,'Solange Anderson','2016-12-22 10:21:18','2016-12-22 10:21:18',NULL,NULL),
	(74,41,'Queria ver provas anteriores ',0,'Ketelyn Amorim','2016-12-22 10:45:35','2016-12-22 10:45:35',NULL,NULL),
	(75,43,'Bom dia!\r\n\r\nGostaria de obter uma informação, estou desempregada desde Abril desde ano, e não tenho condições de pagar a taxa de inscrição, por isso gostaria de obter a isenção da taxa, porem eu não sou uma pessoa beneficiada por nenhum projeto do governo. \r\n\r\nComo posso fazer para conseguir a minha isenção da taxa? \r\nFico no aguardo, desde já agradeço pela sua atenção.\r\n\r\ne-mail para contato: rislley@gmail.com',0,'Rislley Januaria Gomes','2016-12-22 11:49:39','2016-12-22 11:49:39',NULL,NULL),
	(76,23,'Mas ao atualizá-lo no site do banco do brasil haverá alguma cobrança de juros ?',0,'Lara Carneiro Zuniga','2016-12-22 11:57:46','2016-12-22 11:57:46',NULL,NULL),
	(77,23,'Não, sem cobrança de juros.',1,'Karoline Loureiro Silva ','2016-12-22 12:22:26','2016-12-22 12:22:26',NULL,NULL),
	(78,39,'Solange, boa tarde!\r\n\r\nEm breve nosso site terá essas informações. Nosso escritório do Espírito Santo está localizado na Avenida Nossa Senhora da Penha, 280, sala 205, Praia do Canto. Caso queira nos fazer uma visita, estamos à disposição!\r\n\r\n\r\nAtenciosamente\r\n     Karoline ',1,'Karoline Loureiro Silva ','2016-12-22 12:34:55','2016-12-22 12:34:55',NULL,NULL),
	(79,24,'Boa tarde Karoline.\r\nJustamente por não constar a cor \"parda\" no edital, como em todos os outros, acredito que será melhor não arriscar, visto que pode até levar a eliminação, correto? Então gostaria que alterasse sim, de cotista para não cotista.\r\nAgradecido.',0,'Alexandre Barbosa Lacerda','2016-12-22 13:34:20','2016-12-22 13:34:20',NULL,NULL),
	(80,41,'Ketelyn, boa tarde!\r\n\r\nNa próxima semana postaremos um repositório de provas em nosso site. \r\n\r\n\r\n\r\nAtenciosamente\r\n   Karoline ',1,'Karoline Loureiro Silva ','2016-12-22 13:52:13','2016-12-22 13:52:13',NULL,NULL),
	(81,24,'Alexandre, boa tarde!\r\n\r\nFoi alterado conforme sua solicitação.\r\n\r\n\r\n\r\nAtenciosamente \r\n   Karoline\r\n\r\n\r\n',1,'Karoline Loureiro Silva ','2016-12-22 14:24:40','2016-12-22 14:24:40',NULL,NULL),
	(82,49,'Olá, boa tarde! Inseri uma opção errada no cadastro. Coloquei participante por Cota pois não sabia que a cota era para participantes negros e achava que era para escola pública. Eu queria mudar a inscrição. Me ajudem!',0,'Maritza Andrade de Sousa Coutinho','2016-12-22 15:26:14','2016-12-22 15:26:14',NULL,NULL),
	(83,43,'Rislley, boa tarde!\r\n\r\nDe acordo com os itens:\r\n7.13.1. Os pedidos de isenção de taxa de inscrição deverão ser feitos através da comprovação de inscrição do candidato no Cadastro Único para Programas Sociais do Governo Federal, regulamentado pelo Decreto nº 6.135, de 26 de junho de 2007.\r\n7.13.2. Não será aceita a solicitação de isenção do pagamento da taxa de inscrição por outro meio diferente do estabelecido nos termos deste edital.\r\n\r\nA isenção só será concedida nesse caso explicitado pelo edital.\r\n\r\nAtenciosamente\r\n      Karoline',1,'Karoline Loureiro Silva ','2016-12-22 15:42:42','2016-12-22 15:42:42',NULL,NULL),
	(84,49,'Maritza, boa tarde!\r\n\r\nFique tranquila! Já foi alterado conforme sua solicitação.\r\n\r\n\r\n\r\n\r\nAtenciosamente\r\n      Karoline ',1,'Karoline Loureiro Silva ','2016-12-22 15:45:16','2016-12-22 15:45:16',NULL,NULL),
	(85,50,'Boa tarde,\r\nComo eu faço para ter acesso as provas aplicadas anteriormente a fim de estudo para a próxima seleção?',0,'Camila Pereira Simmer','2016-12-22 16:29:06','2016-12-22 16:29:06',NULL,NULL),
	(86,50,'Camila, boa tarde! \r\n\r\nNa próxima semana postaremos um repositório de provas em nosso site. \r\n\r\nAtenciosamente \r\n     Karoline',1,'Karoline Loureiro Silva ','2016-12-22 16:32:52','2016-12-22 16:32:52',NULL,NULL),
	(87,51,'olá boa tarde , eu errei o número da minha identidade, como faço pra consertar ?',0,'Katiuscia Nascimento Da Silva','2016-12-22 17:01:55','2016-12-22 17:01:55',NULL,NULL),
	(88,55,'BOA NOITE,\r\n\r\nGOSTARIA DE SABER QUAIS OS LOCAIS DA PROVA DO CONCURSO?\r\n\r\nOBRIGADA',0,'LORENA MATIAS EUGENIO','2016-12-22 20:24:34','2016-12-22 20:24:34',NULL,NULL),
	(89,56,'Boa noite, \r\n\r\nGostaria de saber qual o valor do vale alimentação e refeição do cargo assistente administrativo, pois o mesmo não está descrito no edital.\r\n\r\nE gostaria de confirmar se uma pessoa pode concorrer as 3 vagas de assistente.\r\n\r\nObrigada.',0,'Josiane Ramalho dos Santos','2016-12-22 23:48:19','2016-12-22 23:48:19',NULL,NULL),
	(90,57,'Bom dia\r\nessas vagas serão em quais cidades do Espirito Santo?',0,'Kamyla Fernandes Batista Lessa','2016-12-23 08:14:46','2016-12-23 08:14:46',NULL,NULL),
	(91,60,'BOM DIA, PAGUEI MINHA INSCRIÇAO E NO SITE NÃO CONSTA O PAGAMENTO, AGUARDO RETORNO',0,'RACHEL CHRISTINE DE ALENCAR FIALHO','2016-12-23 11:39:55','2016-12-23 11:39:55',NULL,NULL),
	(92,62,'OI BOA TARDE\r\n',0,'ROSILEIA PIMENTA GOMES PASSOS','2016-12-23 12:38:52','2016-12-23 12:38:52',NULL,NULL),
	(93,51,'Katiuscia, boa tarde!\r\n\r\nVocê pode ter acesso a sua inscrição sempre que necessário, utilizando o seu e-mail e a senha que você criou na hora de se cadastrar para o concurso. Qualquer dúvida estamos à disposição!\r\n\r\n\r\nAtenciosamente \r\n   Karoline \r\n',1,'Karoline Loureiro Silva ','2016-12-23 15:37:56','2016-12-23 15:37:56',NULL,NULL),
	(94,55,'Lorena, boa tarde!\r\n\r\nAs provas irão acontecer nos municípios de Vitória, Linhares e Cachoeiro do Itapemirim. Já o lugar específico de cada candidato só será divulgado no site a partir do dia 07 de Março de 2017, conforme cronograma do edital.\r\n\r\n\r\nAtenciosamente\r\n    Karoline\r\n\r\n',1,'Karoline Loureiro Silva ','2016-12-23 15:47:36','2016-12-23 15:47:36',NULL,NULL),
	(95,57,'Kamyla, boa tarde!\r\n\r\nAs vagas são para a cidade de Vitória.\r\n\r\n\r\n   Atenciosamente\r\n         Karoline \r\n\r\n',1,'Karoline Loureiro Silva ','2016-12-23 15:52:19','2016-12-23 15:52:19',NULL,NULL),
	(96,60,'Rachel, boa tarde!\r\n\r\nAté segunda feira você receberá o retorno bancário. Caso não aconteça, entre em contato conosco novamente.\r\n\r\n\r\nAtenciosamente\r\n     Karoline  ',1,'Karoline Loureiro Silva ','2016-12-23 15:59:19','2016-12-23 15:59:19',NULL,NULL),
	(97,62,'Olá, Boa tarde!\r\n\r\nPois não?',1,'Karoline Loureiro Silva ','2016-12-23 16:00:59','2016-12-23 16:00:59',NULL,NULL),
	(98,56,'Josiane, Boa tarde!\r\n\r\nEntramos em contato com o Crefito15 para nos informarmos a respeito destes valores, dos vales alimentação e refeição, porém não conseguimos, insistiremos na segunda-feira. Em relação as vagas, você pode sim concorrer às três vagas administrativas.\r\n\r\n\r\nAtenciosamente \r\n   Karoline \r\n',1,'Karoline Loureiro Silva ','2016-12-23 16:24:15','2016-12-23 16:24:15',NULL,NULL),
	(99,72,'Gostei do sistema\r\nEstá ficando SHOW',0,'tauan Queiroz SOARES','2016-12-24 20:17:07','2016-12-24 20:17:07',NULL,NULL),
	(100,75,'Preciso alterar um dos meus dados no cadastro como que faço? Eu não sou cotista mais coloquei errado.',0,'Sibelly Barbosa Francisco','2016-12-25 20:46:01','2016-12-25 20:46:01',NULL,NULL),
	(101,72,'Tauan, bom dia!\r\n\r\nFicamos felizes pelo seu retorno, isso é importante para o nosso trabalho.\r\n\r\n\r\n\r\n\r\nAtenciosamente\r\n   Karoline \r\n\r\n\r\n',1,'Karoline Loureiro Silva ','2016-12-26 09:48:36','2016-12-26 09:48:36',NULL,NULL),
	(102,75,'Sibelly, bom dia!\r\n\r\nAo fazer a sua inscrição, você cadastrou o seu e-mail e uma senha. Utilize os mesmos para acessar o sistema e alterar o que precisa. Caso não consiga, entre em contato novamente.\r\n\r\n\r\n\r\n\r\nAtenciosamente\r\n     Karoline ',1,'Karoline Loureiro Silva ','2016-12-26 09:53:25','2016-12-26 09:53:25',NULL,NULL),
	(103,93,'como pedir isenção?',0,'HUGO RODRIGUES PATROCINIO','2016-12-27 10:01:04','2016-12-27 10:01:04',NULL,NULL),
	(104,93,'Hugo a resposta a sua pergunta encontra-se disponibilizada no item 7.13 do Edital CREFITO 15 1/2016',1,'VALDIR LIMA DE AZEVEDO','2016-12-27 10:55:16','2016-12-27 10:55:16',NULL,NULL),
	(105,106,'Gostaria de saber até quando posso pagar o boleto.',0,'ANDERSON CAMILATO DO NASCIMENTO','2016-12-28 11:51:59','2016-12-28 11:51:59',NULL,NULL),
	(106,107,'Por engano eu fiz a inscrição duas vezes, tem algum problema?',0,'PEDRO ELIAS GONÇALVES SANTOS','2016-12-28 12:30:50','2016-12-28 12:30:50',NULL,NULL),
	(107,110,'Bom dia!\r\n\r\nFiz a minha inscrição e gerei o Boleto, porém o vencimento veio para 30/12/2016, estou em dúvida quanto a validade da minha inscrição uma vez que só terei como efetuar o pagamento após 05/01/2017 e também ficou confuso, pois o fim das inscrições de acordo com o edital será 13/02/2017.\r\n\r\nDesde já agradeço o retorno e desejo a todos Boas Festas!\r\n\r\n',0,'ADRIANA DE OLIVEIRA MOURA','2016-12-28 13:54:32','2016-12-28 13:54:32',NULL,NULL),
	(108,106,'Boa tarde, Anderson!\r\n\r\nA data de vencimento do boleto é sempre com um prazo de dois dias, após ser gerado. Caso ele vença e você ainda não tenha pago, pode atualizá-lo no site do Banco do Brasil. \r\n\r\n\r\nAtenciosamente Karoline',1,'KAROLINE LOUREIRO SILVA ','2016-12-28 15:19:12','2016-12-28 15:19:12',NULL,NULL),
	(109,107,'Pedro, boa tarde!\r\n\r\nVocê pode entrar na aba usuário do site. Lá vai utilizar seu e-mail  e a senha que criou durante o processo de inscrição e apagar um das inscrições. Caso não consiga, entre em contato que te ajudaremos.\r\n\r\nAtenciosamente\r\n   Karoline ',1,'KAROLINE LOUREIRO SILVA ','2016-12-28 15:23:56','2016-12-28 15:23:56',NULL,NULL),
	(110,110,'Boa tarde, Adriana!  \r\n\r\n A data de vencimento do boleto é sempre com um prazo de dois dias, após ser gerado. Caso ele vença e você ainda não tenha pago, pode atualizá-lo no site do Banco do Brasil. Qualquer dúvida estamos à disposição!\r\n\r\nAtenciosamente Karoline',1,'KAROLINE LOUREIRO SILVA ','2016-12-28 15:26:48','2016-12-28 15:26:48',NULL,NULL),
	(111,106,'Obrigado. Vai até que dia prazo de inscrição? Fevereiro?',0,'ANDERSON CAMILATO DO NASCIMENTO','2016-12-28 17:32:25','2016-12-28 17:32:25',NULL,NULL),
	(112,60,'Boa tarde, voces já fizeram algum concurso anterior a este com o mesmo cargo? existem provas anteriores, de outros concursos que podem ser baixadas?',0,'RACHEL CHRISTINE DE ALENCAR FIALHO','2016-12-28 17:47:24','2016-12-28 17:47:24',NULL,NULL),
	(113,114,'Boa noite, existe duas inscrições para o concurso de fisioterapia do Espírito Santo, e percebi uma inscrição está confirmada e outra está como pendente, porém as duas inscrições são para o mesmo cargo. Observei que na tabela de isenção de taxa, encontra-se um S frente ao meu nome, sendo assim, significa que minha inscrição foi aceita? ',0,'BRENO SPERANDIO FADINI','2016-12-28 18:52:48','2016-12-28 18:52:48',NULL,NULL),
	(114,116,'oi quero trabalha',0,'JESSICA PAIXAO SANTOS','2016-12-28 19:36:25','2016-12-28 19:36:25',NULL,NULL),
	(115,122,'Bom dia...Meu nome é Lucilene Silva Santos -  eu acabei inscrever para a vaga de Assistente de Processos.\r\ngostaria de saber se tenho como recorrer para adquirir taxa isenção, por e-star desempregada. Num.ero de Nis correto, ativo : 12001109867.\r\nCTPS 1361696/0003-0  (ES)',0,'LUCILENE SILVA SANTOS','2016-12-29 09:34:45','2016-12-29 09:34:45',NULL,NULL),
	(116,124,'Solicitei a isenção da taxa no lugar do num. do NIS coloquei o Num. do PIS,\r\nComo procedo neste caso. \r\nNão tenho  o num. do NIS.',0,'ALDO JOSÉ DA ROCHA','2016-12-29 10:04:05','2016-12-29 10:04:05',NULL,NULL),
	(117,125,'Bom dia!\r\n\r\nGostaria de saber como faço para pedir isenção da taxa ? ',0,'KARINA GOMES BRUNELLI','2016-12-29 10:10:12','2016-12-29 10:10:12',NULL,NULL),
	(118,106,'Bom dia, Anderson!\r\n\r\nAs inscrições vão até 13 de Fevereiro.\r\n\r\n\r\nAtenciosamente\r\n    Karoline',1,'KAROLINE LOUREIRO SILVA ','2016-12-29 10:43:51','2016-12-29 10:43:51',NULL,NULL),
	(119,60,'Rachel, boa tarde! \r\n\r\nNa próxima semana postaremos um repositório de provas em nosso site. \r\n\r\nAtenciosamente Karoline',1,'KAROLINE LOUREIRO SILVA ','2016-12-29 10:46:08','2016-12-29 10:46:08',NULL,NULL),
	(120,114,'Breno, bom dia!\r\n\r\nProvavelmente a que está como pendente foi descartada por já ter outra confirmada, de qualquer forma vou buscar essa informação com a equipe de TI. Se na tabela da isenção de taxa o S está na frente do seu nome é porque foi aceito o seu pedido.\r\n\r\nAtenciosamente \r\n   Karoline ',1,'KAROLINE LOUREIRO SILVA ','2016-12-29 10:52:48','2016-12-29 10:52:48',NULL,NULL),
	(121,116,'Olá Jessica, \r\n\r\nDesculpe, não entendi!\r\n\r\n\r\n\r\n\r\nAtenciosamente\r\n    Karoline ',1,'KAROLINE LOUREIRO SILVA ','2016-12-29 10:53:54','2016-12-29 10:53:54',NULL,NULL),
