	(127,129,'Boa tarde! \r\nMeu nome é Jeane , fiz uma inscrição para o cargo de assistente de qualidade , mais não entendi . Eu não sou deficiente fisico , coloquei como não , mais quando visualizo vem para mim , como não confirmado , mais eu confirmei que não sou . Isso dá algum problema ? gostaria que olhassem para mim .\r\n\r\nObrigada . ',0,'JEANE DE OLIVEIRA','2016-12-29 13:44:54','2016-12-29 13:44:54',NULL,NULL),
